its first full year of operation. Major improvements began in 1876, however, and the canal soon grew into the one of the world’s most heavily traveled shipping lanes. In 1875, Great Britain became the largest shareholder in the Suez Canal Company when it bought up the stock of the new Ottoman governor of Egypt.',NULL),(12,49,'2016-09-20 15:48:45','sapiens','907T- wegdnfeanfa odgjshedhdf gde yrnysgs','Singapore','306-YYr','When it opened, the Suez Canal was only 25 feet deep, 72 feet wide at the bottom, and 200 to 300 feet wide at the surface. Consequently, fewer than 500 ships navigated it in its first full year of operation. Major improvements began in 1876, however, and the canal soon grew into the one of the world’s most heavily traveled shipping lanes. In 1875, Great Britain became the largest shareholder in the Suez Canal Company when it bought up the stock of the new Ottoman governor of Egypt.',NULL),(13,50,'2016-09-20 15:51:45','sapiens','Block 45, Dpw etasocajfr wkfaj sd anfasnb Street, #09-881','Singapore','44474','Ten years later, Egypt shut down the canal again following the Six Day War and Israel’s occupation of the Sinai Peninsula. For the next eight years, the Suez Canal, which separates the Sinai from the rest of Egypt, existed as the front line between the Egyptian and Israeli armies. In 1975, Egyptian President Anwar el-Sadat reopened the Suez Canal as a gesture of peace after talks with Israel. Today, an average of 50 ships navigate the canal daily, carrying more than 300 million tons of goods a year.',NULL),(15,68,'2016-09-22 17:10:57','sapiens','Block 661 Ferguson Road #07-805','Singapore','8979223',NULL,NULL),(16,70,'2016-09-26 14:51:36','sapiens','2364-84  sdufia pegia hedf iefh sbef','Singapore','t63489',NULL,NULL),(17,71,'2016-09-26 15:59:46','Sapiens','Block 657 harinyo street 5, #05-15','Singapore','769600',NULL,NULL),(18,77,'2016-10-03 14:39:54','admin1','Singapore Management UNiversity','Singapore','112233',NULL,NULL);
