c2.org.sg',1,NULL,'Construction began in April 1859, and at first digging was done by hand with picks and shovels wielded by forced laborers. Later, European workers with dredgers and steam shovels arrived. Labor disputes and a cholera epidemic slowed construction, and the Suez Canal was not completed until 1869–four years behind schedule. On November 17, 1869, the Suez Canal was opened to navigation. Ferdinand de Lesseps would later attempt, unsuccessfully, to build a canal across the Isthmus of Panama.',NULL),(48,'2016-09-20 15:46:05','sapiens','webadmin@twc2.org.sg',1,NULL,'When it opened, the Suez Canal was only 25 feet deep, 72 feet wide at the bottom, and 200 to 300 feet wide at the surface. Consequently, fewer than 500 ships navigated it in its first full year of operation. Major improvements began in 1876, however, and the canal soon grew into the one of the world’s most heavily traveled shipping lanes. In 1875, Great Britain became the largest shareholder in the Suez Canal Company when it bought up the stock of the new Ottoman governor of Egypt.',NULL),(49,'2016-09-20 15:48:27','sapiens','socialworker1@twc2.org.sg',1,NULL,'When it opened, the Suez Canal was only 25 feet deep, 72 feet wide at the bottom, and 200 to 300 feet wide at the surface. Consequently, fewer than 500 ships navigated it in its first full year of operation. Major improvements began in 1876, however, and the canal soon grew into the one of the world’s most heavily traveled shipping lanes. In 1875, Great Britain became the largest shareholder in the Suez Canal Company when it bought up the stock of the new Ottoman governor of Egypt.',NULL),(50,'2016-09-20 15:51:19','sapiens','socialworker2@twc2.org.sg',1,NULL,'Ten years later, Egypt shut down the canal again following the Six Day War and Israel’s occupation of the Sinai Peninsula. For the next eight years, the Suez Canal, which separates the Sinai from the rest of Egypt, existed as the front line between the Egyptian and Israeli armies. In 1975, Egyptian President Anwar el-Sadat reopened the Suez Canal as a gesture of peace after talks with Israel. Today, an average of 50 ships navigate the canal daily, carrying more than 300 million tons of goods a year.',NULL),(59,'2016-09-21 17:17:44','denisovus','jillratnam@hotmail.com',1,NULL,NULL,NULL),(61,'2016-09-21 17:18:10','neanderthalis','christine.pelly@gmail.com',1,NULL,NULL,NULL),(62,'2016-09-21 17:18:06','debbie1','aux.verum@gmail.com',1,NULL,NULL,NULL),(63,'2016-09-21 17:18:16','Minyi1','russell.heng@twc2.org.sg',1,NULL,NULL,NULL),(64,'2016-09-21 17:18:48','admin1','eatmarcus@gmail.com',1,NULL,NULL,NULL),(66,'2016-09-21 17:19:41','Minyi1','socialworker5@twc2.org.sg',1,NULL,NULL,NULL),(68,'2016-09-22 17:10:20','sapiens','accountsofficer@twc2.org.sg',1,NULL,NULL,NULL),(69,'2016-09-23 20:17:46','sapiens','casehelp3@twc2.org.sg',1,NULL,NULL,NULL),(70,'2016-09-26 14:51:20','sapiens','richmond-dental@uwetovb.com.sg',0,'5eO7J8fOywyP5YnF9bNU8HYBuipQ2FxhfCQORwurKPbQfABIn0BqCJriLY5NOB5g',NULL,NULL),(71,'2016-09-26 15:59:08','Sapiens','dogxpert@gondola.com',0,'ToNUYj11wY1kVpGiCtv8dOUNg3AtZ66RoQxQuZRXPWKkUdzjmmGHr0xqydiTDUHG',NULL,NULL),(72,'2016-09-28 13:39:19','sapiens','gautamjoseph@gmail.com',0,'hvZ2ynVW8XTU9RpIVXJ2uGIi0krbgQeUr9rRzixVY7hGA4d6iLm2ketMnEZOWvEW',NULL,NULL),(75,'2016-09-30 17:01:33','sapiens','twc2media@gmail.com',1,NULL,NULL,NULL),(77,'2016-10-03 14:39:33','admin1','test@mail.com',0,'R5FE7dmlYB7JtPoCvkRSGAXDCjXV6g5T8BF2zL7eY9Xlr2uFnSQpTxc50x7LiAxK',NULL,NULL);
