ted it in its first full year of operation. Major improvements began in 1876, however, and the canal soon grew into the one of the world’s most heavily traveled shipping lanes. In 1875, Great Britain became the largest shareholder in the Suez Canal Company when it bought up the stock of the new Ottoman governor of Egypt.',NULL),(49,'2016-09-20 15:48:11','sapiens','65','41009899','When it opened, the Suez Canal was only 25 feet deep, 72 feet wide at the bottom, and 200 to 300 feet wide at the surface. Consequently, fewer than 500 ships navigated it in its first full year of operation. Major improvements began in 1876, however, and the canal soon grew into the one of the world’s most heavily traveled shipping lanes. In 1875, Great Britain became the largest shareholder in the Suez Canal Company when it bought up the stock of the new Ottoman governor of Egypt.',NULL),(50,'2016-09-20 15:51:06','sapiens','65','4646346558','Ten years later, Egypt shut down the canal again following the Six Day War and Israel’s occupation of the Sinai Peninsula. For the next eight years, the Suez Canal, which separates the Sinai from the rest of Egypt, existed as the front line between the Egyptian and Israeli armies. In 1975, Egyptian President Anwar el-Sadat reopened the Suez Canal as a gesture of peace after talks with Israel. Today, an average of 50 ships navigate the canal daily, carrying more than 300 million tons of goods a year.',NULL),(64,'2016-09-21 17:28:11','marcus2','65','81114444','lovely number',NULL),(68,'2016-09-22 17:10:05','sapiens','65','98769876',NULL,NULL),(70,'2016-09-26 14:50:59','sapiens','65','135567',NULL,NULL),(71,'2016-09-26 15:58:43','Sapiens','65','69635852',NULL,NULL),(77,'2016-10-03 14:39:22','admin1','65','91212124',NULL,NULL);
