INSERT INTO `SKILL_ASSIGNMENT` VALUES (15,'2016-09-14 17:38:49','admin1','no other eio',NULL,'no remarks skill','Accounting'),(22,'2016-09-14 19:27:58','Miguel1',NULL,NULL,NULL,'Infotech'),(36,'2016-09-19 11:28:14','admin1','The power of such eruptions is measured using the Volcanic Explosivity Index (VEI) a',NULL,'The power of such eruptions is measured using the Volcanic Explosivity Index (VEI) a classification system developed in the 1980 that\'s somewhat akin to the magnitude scale for earthquakes. The scale goes from 1 to 8, and each succeeding VEI is 10 times greater than the last.','Has shelter space'),(47,'2016-09-20 15:44:05','sapiens','The low price of oil is allowing cargo vessels to avoid the costly tariffs of the Suez and Panama canals',NULL,'Construction began in April 1859, and at first digging was done by hand with picks and shovels wielded by forced laborers. Later, European workers with dredgers and steam shovels arrived. Labor disputes and a cholera epidemic slowed construction, and the Suez Canal was not completed until 1869–four years behind schedule. On November 17, 1869, the Suez Canal was opened to navigation. Ferdinand de Lesseps would later attempt, unsuccessfully, to build a canal across the Isthmus of Panama.','Academia'),(49,'2016-09-20 15:49:28','sapiens','dgsrhafoaijgs p gkas jdgosidgjs odigsjv s jdg sodfsh gsbsbx bgo tye w 4645 6 867i',NULL,'When it opened, the Suez Canal was only 25 feet deep, 72 feet wide at the bottom, and 200 to 300 feet wide at the surface. Consequently, fewer than 500 ships navigated it in its first full year of operation. Major improvements began in 1876, however, and the canal soon grew into the one of the world’s most heavily traveled shipping lanes. In 1875, Great Britain became the largest shareholder in the Suez Canal Company when it bought up the stock of the new Ottoman governor of Egypt.','Has event space'),(50,'2016-09-20 15:52:33','sapiens','segs dgas  odgi weg osa dbv sdfb',NULL,'Ten years later, Egypt shut down the canal again following the Six Day War and Israel’s occupation of the Sinai Peninsula. For the next eight years, the Suez Canal, which separates the Sinai from the rest of Egypt, existed as the front line between the Egyptian and Israeli armies. In 1975, Egyptian President Anwar el-Sadat reopened the Suez Canal as a gesture of peace after talks with Israel. Today, an average of 50 ships navigate the canal daily, carrying more than 300 million tons of goods a year.','Pro-bono lawyer'),(68,'2016-09-26 23:12:54','Santaclaus',NULL,NULL,NULL,'Physio'),(71,'2016-09-26 16:00:17','Sapiens',NULL,NULL,NULL,'Counselling'),(71,'2016-09-26 16:00:31','Sapiens',NULL,NULL,'Minivan.','Has vehicle');
